import logo from './images/dalilogo.png';
import dashboardIcon from './images/dashboardicon.png';
import inventoryIcon from './images/inventoryicon.png';
import historyIcon from './images/historyicon.png';
import './App.css';

function App() {
  return (
    <div className="App">

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
          <h1>DALI GROCERY</h1>

      </header>

      <navbar>

        <div className="App-nav">

          <div className="App-icon">
            <img src={dashboardIcon} alt="DashboardIcon" width="22" height="22"/>
            <img src={inventoryIcon} alt="InventoryIcon" width="22" height="22"/>
            <img src={historyIcon} alt="HistoryIcon" width="22" height="22"/>
          </div>


            <ul className="App-menu">
              <li>Dashboard</li>
              <li>Inventory</li>
              <li>History</li>
            </ul>


        </div>

      </navbar>







    </div>
  );
}

export default App;
